  return (
    <div className="">
      {data.map((item, index) => (
        <div key={index} className="text-left mb-6">
          <h3 className="text-2xl font-bold">{item.title}</h3>
          <p className="text-base">{item.content}</p>
        </div>
      ))}
    </div>
  );
};

export default IbcSports;
